import React, { Component } from 'react';
import Header from '../components/Header';
import Router from '../components/Router';
import Produto from '../components/Produto';

class Home extends Component {

  constructor(props) {
    super(props);

    this.state = {
      name: ""
    };
  }

  handleChildClick(){
    const {name} = this.props;
    this.setState({
      name: name
    });
  }

  render() {
    return (
      <div>
        <Header />
        <p>{this.state.name}</p>
        <Router />
        <Produto handleClick={this.handleChildClick.bind(this)} />
      </div>
    );
  }
}

export default Home;
